description:
&quot;With two year-old sextuplets and six year-old twins, the Gosselins are hardly your typical American family. Jon and Kate are the ambitious parents of this adorable bunch and they are battling all odds to make sure their brood has a normal, happy childhood. We follow them as they tackle seemingly ordinary life events like pumpkin picking and birthday parties that become extraordinary when you have two sets of energetic multiples.&quot;


